import chord_art from "../images/chord-art.png";
import kochpinski from "../images/kochpinski.png";
import snowflake from "../images/snowflake.png";
import plasma_ball from "../images/plasma-ball.png";
import hexagon_star from "../images/hexagon-star.png";
import xt_square from "../images/xt-square.png";
import oscillating_rose from "../images/oscillating-rose.png";
import pentaspiral from "../images/pentaspiral.png";

export default {
  "chord-art": chord_art,
  kochpinski,
  snowflake,
  "plasma-ball": plasma_ball,
  "hexagon-star": hexagon_star,
  "xt-square": xt_square,
  "oscillating-rose": oscillating_rose,
  pentaspiral
};
